import React from "react";
import fetch from "./Fetches";

class App extends React.Component {
  constructor() {
    super();
    this.setState = {
      data: null
    };
  }
  componentDidMount() {
    this.fetchData();
  }
  fetchData = async () => {
    let a = await fetch();
    a.forEach(async doc => {
      await console.log(`${doc.id} => ${doc.data().Name}`);
    });
  };
  render() {
    return <div>HI</div>;
  }
}

export default App;
